import { isIE } from './brower';
import { getRandomBit } from './number';
import { interpolation } from './object';
let INSTANCE = null;
class Utils2js {
    static get getInstance() {
        if (!INSTANCE) {
            INSTANCE = new Utils2js();
        }
        return INSTANCE;
    }
    Logger(channel, options = {}) {
        // 浏览器检测
        function info(message) {
            if (isIE) {
                console.log(interpolation('[{0}]', channel), message);
            }
            else {
                if (options && options.color) {
                    options.color = options.color;
                }
                else {
                    options.color = getRandomBit(6, 16);
                }
                console.log(interpolation('%c[{0}]', channel), interpolation('color: {0}', options.color), message);
            }
        }
        return {
            info
        };
    }
    /**
     * 更准确的类型判定方法
     * 返回类型如下：number/string/boolean/object/function/regexp/null/undefined/array/date/error
     *
     * @param {*} params
     * @returns {string} 统一返回小写的具体类型名称
     * @memberof Utils2js
     */
    Type(params) {
        const REGEXP = /^\[object\W([a-zA-Z]+)\]$/g;
        const waitingForReg = Object.prototype.toString.call(params);
        const handleResult = REGEXP.exec(waitingForReg);
        return handleResult[1].toLowerCase();
    }
}
const STANCE__UTILS2JS = Utils2js.getInstance;
export const Logger = STANCE__UTILS2JS.Logger;
export const Type = STANCE__UTILS2JS.Type;

/**
 * 整数
 * @param  {number} Num
 */
function isInt(Num) {
    return Math.floor(Num) == Num;
}
function toInt(floatNum) {
    const temp = {
        num: floatNum,
        pow: 1
    };
    // 是整数跳过
    if (isInt(floatNum)) {
        return temp;
    }
    const stringNum = floatNum + '';
    const len = stringNum.split('.')[1].length;
    const pow = Math.pow(10, len);
    // 坑
    // 0.55 * 100 = 55.00000000000001 用parseInt强制转整数
    temp.num = parseInt((floatNum * pow).toString(), 10);
    temp.pow = pow;
    return temp;
}
/**
 * 比较两个数 取整 取最大幂数
 * @param  {number} num1 第一个number
 * @param  {number} num2 第二个number
 * @param  {string} op 指定操作类型
 */
function operate(num1, num2, op) {
    const toInt1 = toInt(num1);
    const toInt2 = toInt(num2);
    // 取整
    const t1 = toInt1.num;
    const t2 = toInt2.num;
    // 取幂数
    const pow1 = toInt1.pow;
    const pow2 = toInt2.pow;
    // 先比较幂数大小 再做处理
    switch (op) {
        case 'add':
            if (pow1 == pow2) {
                return (t1 + t2) / pow1;
            }
            if (pow1 > pow2) {
                return (t1 + t2 * (pow1 / pow2)) / pow1;
            }
            else {
                return (t1 * (pow2 / pow1) + t2) / pow2;
            }
        case 'sub':
            if (pow1 == pow2) {
                return (t1 - t2) / pow1;
            }
            if (pow1 > pow2) {
                return (t1 - t2 * (pow1 / pow2)) / pow1;
            }
            else {
                return (t1 * (pow2 / pow1) - t2) / pow2;
            }
        case 'ride':
            return (t1 * t2) / (pow1 * pow2);
        case 'divide':
            // 参考  55 / 0.22 => ( 55 / 22 ) * (100 / 1)  注意分子和分母顺序
            return (t1 / t2) * (pow2 / pow1);
    }
}
const float = {
    add(num1, num2) {
        return operate(num1, num2, 'add');
    },
    sub(num1, num2) {
        return operate(num1, num2, 'sub');
    },
    ride(num1, num2) {
        return operate(num1, num2, 'ride');
    },
    divide(num1, num2) {
        return operate(num1, num2, 'divide');
    }
};
/**
 * 获取指定位数的X进制数
 * @param {number} num 指定输出的位数
 * @param {number} bit 指定进制数 8/10/16进制
 * @returns {string}
 */
function getRandomBit(num, bit = 10) {
    let result = '#';
    if (typeof num != 'number') {
        throw new Error('num类型必须为数字!');
    }
    for (let i = 0; i <= num - 1; i++) {
        result += Math.floor(Math.random() * bit).toString(bit);
    }
    return result;
}
export { float, getRandomBit };

